import React from "react";

function Services() {
  return (
      <div className="services">
          <div class="bigimage">
          <h1 id="header"style={{fontWeight: "100",marginTop:110}}>We Automate To Become More Accurate</h1>
          <p style={{textAlign:"center",marginTop:60}}>Bringing you automated content processing<br />services at the blink of an eye</p>

          <div class="row">
            <hr id="border"></hr>
          </div>

          <img src="assets/images/upbutton-04.png"class="rounded mx-auto d-block"  alt=""/>
          <p style={{textAlign:"center"}}><strong>Upload Image</strong><br/>or drag a file</p>
          <div id="button_back" style={{paddingLeft:"10%"}}>
            <button id="button1">Download App</button>
            <button id="button2"style={{marginRight:"10%"}}>Remove Background</button>
</div>
      </div>
      </div>
  );
}

export default Services;
